//! Lookup table for the cumulative cost curve used by the curve crate.
//!
//! Values are stored as fixed-point numbers:
//! - `x` uses Q8.24 (stored as u32, representing [0, 12])
//! - `s` uses Q16.48 (stored as u64)
//!
//! The sigmoid curve is shifted right by 6.0, so the inflection point is at x=6.0.
//! The table is strictly increasing in `x` and `s`, and it covers the domain
//! `[LUT_X_MIN, LUT_X_MAX]`. Interpolation and inversion logic live in
//! `math`, which assumes inputs remain within this domain.
//!
//! The LUT is generated by `backend/curve/src/bin/lutgen.rs`.

/// Number of curve point samples in the LUT.
pub(crate) const LUT_SIZE: usize = 1025;
/// Maximum cumulative cost in the LUT (Q16.48, as u64).
pub const LUT_S_MAX: u64 = S_LUT[LUT_SIZE - 1];
/// Minimum x value in the LUT (Q8.24, as u32).
pub const LUT_X_MIN: u32 = x_at_const(0);
/// Maximum x value in the LUT (Q8.24, as u32).
pub const LUT_X_MAX: u32 = x_at_const(LUT_SIZE - 1);

#[inline]
pub const fn x_at_const(i: usize) -> u32 {
    X_LUT[i]
}

